export function Login(){
    return(
        <Main>
            <Title>
                Sistema Paciente Online
            </Title>
            <LoginBox>
                <UserPhoto/>
                <label>
                    Email
                </label>
                <Input>
                </Input>
                <label>
                    Senha
                </label>
                <Input>
                </Input>
            </LoginBox>
        </Main>
    )
}
